input = ''
# input = 'zcfzfwzzqfrljwzlrfnpqdbhtmscgvjw#'

def is_str_unique(input: dict):
    for val in input.values():
        if val > 1:
            return False
    return True




def decipher():
    sub_str = input[0:14]
    char_dict = {}
    for i in range(0, 14):
        if sub_str[i] in char_dict:
            char_dict[sub_str[i]] = char_dict[sub_str[i]] + 1
        else:
            char_dict[sub_str[i]] = 1
    if is_str_unique(char_dict):
        print(f'The answer is 14')
        return

    # process rest of input
    for i in range(1, len(input)):

        old_left_char = input[i-1]
        new_right_char = input[i+13]

        char_dict[old_left_char] = char_dict[old_left_char] - 1

        if new_right_char in char_dict:
            char_dict[new_right_char] = char_dict[new_right_char] + 1
        else:
            char_dict[new_right_char] = 1

        if is_str_unique(char_dict):
            print (f'The answer is {i+14}')
            return



